import { Component, ViewChild } from '@angular/core';
import { IonicPage, NavController, NavParams, ModalController, Platform } from 'ionic-angular';
import { DrawpadPage } from '../drawpad/drawpad';
import { LocalStorageProvider } from '../../providers/local-storage/local-storage';
import { DocumentViewer } from '@ionic-native/document-viewer/ngx';
import { File } from '@ionic-native/file/ngx';
import * as pdfmake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import { UtilsProvider } from '../../providers/utils/utils';

declare var cordova:any;    //global;

@IonicPage()
@Component({
  selector: 'page-order',
  templateUrl: 'order.html', 
})
export class OrderPage {

  order: any;
  parentPage: any;
  
  constructor(public navCtrl: NavController, public navParams: NavParams, 
			  public localStorage: LocalStorageProvider, public viewer: DocumentViewer,
			  public modalCtrl: ModalController, public platform: Platform,
			  public utils: UtilsProvider, public file: File) {
		
	  this.parentPage = this.navParams.get("parentPage");
	  this.order = this.navParams.get('order');
	  this.order.itemList = this.order.itemList  || [];

  }

  openViewer(){
	  
	var options = {
		title: '__perfumes 300',
		documentView : {
			closeLabel : 'Cerrar'
		},
		navigationView : {
			closeLabel : 'Close'
		},
		email : { enabled : true },
		print : { enabled : true  },
		openWith : { enabled : true },
		bookmarks : { enabled : true },
		search : { enabled : true }
	}
  }
  
  refresItemList(order){
	  this.order.itemList = order.itemList || [];
	  this.localStorage.updateServices(this.order);
  }
  
  ionViewWillLeave() {
      this.parentPage.ionViewWillEnter();
  }
  
  addNewForm() {
    this.navCtrl.push('FormPage',{'order':this.order, 'parentPage': this, 'action':'new'});
  }

  goToForm(indx) {
    this.navCtrl.push('FormPage',{'order':this.order, 'parentPage': this, 'action':'update', 'indx': indx});
  }
  
  openSignatureModel() {
    let modal = this.modalCtrl.create(DrawpadPage);
    modal.present();
    modal.onDidDismiss((data: any) => {
      if (data) {
		this.order.signatureImage = data.signatureImage;
		this.localStorage.updateServices(this.order);
      }
    });
  }

  files: any;  
  createPDF() {
	  
		const ROOT_DIRECTORY = 'file:///android_asset/';
	    this.files = [{dir: 'file:///android_asset/css/', name: 'reports.css',status:'0'},
				{dir: 'asset/css/', name: 'reports.css',status:'0'},
				{dir: 'www/asset/css/', name: 'reports.css',status:'0'}];

	  
	  let options = {
		  documentSize: "A4",
		  landscape: "portrait",
		  type: "share",
		  fileName: 'assets/perfumes.pdf',
		  baseUrl: ''
	  }
	  let cssFile = 'assets/css/reports.css';
	  let pdfHead = '<link rel="stylesheet" href="'+cssFile+'">';
	  let logoSrc = 'data:image/png;base64,';
	  let pdfBody = '<img style="width:auto;height:75px;border:solid 1px red;" id="base64image" src='+logoSrc+'/>';
		  pdfBody = pdfBody + 'line<img style="width:auto;height:75px;border:solid 1px red;" src="assets/imgs/logoInvitroAlfa_968x576.png"/>';
		  pdfBody = pdfBody + 'line2<img style="width:auto;height:75px;border:solid 1px red;" src="www/assets/imgs/logoInvitroAlfa_968x576.png"/>';
		  pdfBody = pdfBody + 'file_asset<img style="width:auto;height:75px;border:solid 1px blue;" src="'+ROOT_DIRECTORY+'/imgs/logoInvitroAlfa_968x576.png"/>';
	      pdfBody = pdfBody + '<h5 style="color:blue;">Orden de Produccin {{order.id}}</h5>';
	      pdfBody = pdfBody + '<div style="color:yellow"> This is a invitro report</div>';
	  
	  let pdfhtml = '<html><head>'+pdfHead+'</head><body>'+pdfBody+'</body></html>';
	  
	  if(this.platform.is('cordova')) {
		  cordova.plugins.pdf.fromData(pdfhtml,options)
		  .then((base64) => 'ok')
		  .catch((err) => {
			alert('pdf error'+err);  
		  });
	  }
  }
  
  makePdf() {
		let self = this;
		pdfmake.vfs = pdfFonts.pdfMake.vfs;
	
		let logoSrc = 'data:image/png;base64,';
		var docDefinition = {content: [{
				columns: [{image: logoSrc,fit: [100, 100]},[{ text: 'BITCOIN', style: 'header' },{ text: 'Cryptocurrency Payment System', style: 'sub_header' },{ text: 'WEBSITE: https://bitcoin.org/', style: 'url' },
				]]}],
				styles: {
					header: {
						bold: true,
						fontSize: 20,
						alignment: 'right'
					},
					sub_header: {
						fontSize: 18,
						alignment: 'right'
					},
					url: {
						fontSize: 16,
						alignment: 'right'
					}
				},
				pageSize: 'A4',
				pageOrientation: 'portrait'
			};
			
		if(this.platform.is('cordova')) {
			pdfmake.createPdf(docDefinition).getBuffer(function (buffer) {
				let utf8 = new Uint8Array(buffer);
				let binaryArray = utf8.buffer;
				self.saveToDevice(binaryArray,"Invitro.pdf")
			});
		}		
		else {
			pdfmake.createPdf(docDefinition).open();
		}
    }
	
	saveToDevice(data:any,savefile:any){
		let self = this;
		self.file.writeFile(self.file.externalDataDirectory, savefile, data, {replace:false});
		this.utils.showMessage('File saved to your device');
	}

}








